import React from 'react';
import { Link } from 'react-router-dom'

import Logo from '../../assets/logo.svg'

function Login() {
  return (
    <>
      <Link to="/">
        <img src={Logo} alt="logo, get car"/>
      </Link>
    </>
  )
}
export default Login;
